import "../../CSS/imager_settings.css";
import { Container, Row, Col } from "react-bootstrap";
import React from "react";
import { useState, useEffect } from "react";
import CommonRow from "../../components/NavBar/NavBar";
import MissionBreadcrumbs from "../../components/Tools/Breadcrumbs/missionBreadCrumbs";
import { Box } from "@mui/material";
import axios from "axios";

function Imager_Settings() {
  const [weatherData, setWeatherData] = useState(null);

  useEffect(() => {
    const interval = setInterval(() => {
      axios
        .get("http://3.145.131.67:8000/weather/data/")
        .then((response) => {
          setWeatherData(response.data);
        })
        .catch((error) => {
          console.log(error);
        });
    }, 10000);
    return () => clearInterval(interval);
  }, []);
  return (
    <Container fluid>
      <div>
        <CommonRow />
      </div>
      {/* ------------------------------------------------- row 1 END ----------------------------- */}
      <Row>
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <div className="sensor-measurement-settings">
            <div className="sensor-measurement-settings-title">
              FieldDock Mission Planner
            </div>
          </div>
        </Col>
      </Row>
      {/* ------------------------------------------------- row 2 END ----------------------------- */}
      <Row
        style={{
          justifyContent: "center",
          alignItems: "center",
          display: "flex",
        }}
      >
        <div
          style={{
            display: "flex",
            width: "94%",
            marginBottom: "30px",
          }}
        >
          <Col xs={12} sm={6} md={6} lg={8} xl={8} xxl={8}>
            <div
              style={{
                height: "815px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                marginRight: "15px",
                border: "1px solid #797979",
                backgroundColor: "transparent",
              }}
            >
              {/* <MapComponent /> */}
            </div>
          </Col>
          <Col /*<div>xs={12} sm={6} md={6} lg={4} xl={4} xxl={4}> */>
            <div
              style={{
                display: "flex", // Set the display to flex
                flexDirection: "column", // Children are stacked vertically
                height: "700px",
                alignItems: "center", // Center children horizontally
                marginLeft: "15px",
                border: "1px solid #797979",
                backgroundColor: "transparent",
                overflow: "auto",
              }}
            >
              <div //?DIV BOX FOR THE BREAD CRUMBS
                style={{
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                  borderBottom: "1px solid #797979",
                  // marginTop: "10px",
                  alignSelf: "stretch", // Make this div stretch to fill its parent's width
                }}
              >
                <MissionBreadcrumbs />
              </div>
              <div //?DIV BOX FOR STATUS, METRICS, ENV, & FLIGHT LOGS TO BE RENDERED
                style={{
                  height: "86%",
                  border: "1px solid #797979",
                  marginTop: "20px",
                  width: "90%",
                  justifyContent: "center",
                  alignItems: "center",
                  display: "flex",
                  flexDirection: "column",
                }}
              >
                <Box
                  style={{
                    borderTop: "1px solid #3898EC",
                    width: "80%",
                    height: "100px",
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                >
                  <Box
                    style={{
                      position: "absolute",
                      transform: "translate(20%, -230%)", // This will center both horizontally and vertically
                      backgroundColor: "#181818", // This is the background color of your parent box, adjust if it's different
                      padding: "0 7px",
                      zIndex: 1,
                      fontSize: "15px",
                    }}
                  >
                    Wind
                  </Box>

                  <Box
                    style={{
                      display: "flex",
                      flexDirection: "row",
                      justifyContent: "space-between",
                      alignItems: "center",
                      width: "95%",
                    }}
                  >
                    <Box style={{ textAlign: "center" }}>
                      <div
                        style={{
                          color: "#e8e8e8", // Add  color here
                        }}
                      >
                        Direction
                      </div>
                      <div
                        style={{
                          color: "#00e1b4", // Add  color here
                        }}
                      >
                        {weatherData && weatherData.length > 0
                          ? weatherData[weatherData.length - 1].wind_direction
                          : "N/A"}
                        °
                      </div>
                    </Box>
                    <Box style={{ textAlign: "center" }}>
                      <div
                        style={{
                          color: "#e8e8e8",
                        }}
                      >
                        Wind Speed
                      </div>
                      <div
                        style={{
                          color: "#00e1b4",
                        }}
                      >
                        {weatherData && weatherData.length > 0
                          ? weatherData[weatherData.length - 1].wind_speed
                          : "N/A"}{" "}
                        m/s
                        {/* wind speed code above */}
                      </div>
                    </Box>
                    <Box style={{ textAlign: "center" }}>
                      <div
                        style={{
                          color: "#e8e8e8", // Add  color here
                        }}
                      >
                        Gust
                      </div>
                      <div
                        style={{
                          color: "#00e1b4", // Add  color here
                        }}
                      >
                        {" "}
                        N/A
                        {/* {weatherData && weatherData.length > 0
                      ? weatherData[weatherData.length - 1].gust
                      : "N/A"} */}
                      </div>
                    </Box>
                  </Box>
                </Box>
                <Box
                  style={{
                    borderTop: "1px solid #f59331",
                    width: "80%",
                    height: "150px",
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                >
                  <Box
                    style={{
                      position: "absolute",
                      top: "50%",
                      left: "50%",
                      transform: "translate(-50%, -50%)", // This will center both horizontally and vertically
                      backgroundColor: "#181818", // This is the background color of your parent box, adjust if it's different
                      padding: "0 7px",
                      zIndex: 1,
                      fontSize: "15px",
                    }}
                  >
                    Module
                  </Box>

                  <Box
                    style={{ textAlign: "center", flex: 1, fontSize: "18px" }}
                  >
                    <div style={{ color: "#e8e8e8" }}>Temperature</div>
                    <div style={{ color: "#00e1b4" }}>
                      {weatherData && weatherData.length > 0
                        ? weatherData[weatherData.length - 1].temperature
                        : "N/A"}
                      °F
                    </div>
                    <div style={{ color: "#ff0000" }}>00.00°C</div>
                    <div style={{ color: "#e8e8e8" }}>Visibility</div>
                    <div style={{ color: "#00e1b4" }}>
                      {weatherData && weatherData.length > 0
                        ? weatherData[weatherData.length - 1].visibility
                        : "N/A"}{" "}
                      m
                    </div>
                  </Box>
                  <Box style={{ textAlign: "center", flex: 1 }}>
                    <div style={{ color: "#e8e8e8" }}>Humidity</div>
                    <div style={{ color: "#00e1b4" }}>
                      {weatherData && weatherData.length > 0
                        ? weatherData[weatherData.length - 1].humidity
                        : "N/A"}
                      %
                    </div>
                    <div style={{ color: "#ff0000" }}>-</div>
                    <div style={{ color: "#e8e8e8" }}>UV Index</div>
                    <div style={{ color: "#ff0000" }}>
                      {weatherData && weatherData.length > 0
                        ? weatherData[weatherData.length - 1].uv_index
                        : "N/A"}
                    </div>
                  </Box>
                  <Box style={{ textAlign: "center", flex: 1 }}>
                    <div style={{ color: "#e8e8e8" }}>Air Pressure</div>
                    <div style={{ color: "#00e1b4" }}>
                      {weatherData && weatherData.length > 0
                        ? weatherData[weatherData.length - 1].pressure
                        : "N/A"}{" "}
                      kPa
                    </div>
                    <div style={{ color: "#ff0000" }}>00.00"</div>
                    <div style={{ color: "#e8e8e8" }}>Conditions</div>
                    <div style={{ color: "#00e1b4" }}>
                      {weatherData && weatherData.length > 0
                        ? weatherData[weatherData.length - 1].weather_condition
                        : "N/A"}
                    </div>
                  </Box>
                </Box>
              </div>
            </div>
          </Col>
        </div>
      </Row>
      {/* ------------------------------------------------- row 3 END ----------------------------- */}
    </Container>
